  false,\n\t\"url\": null,\n\t\"notes\": \"Watershed Sciences, Inc. collected Light
  Detection and Ranging (LiDAR) data of Western Lewis County for the Puget Sound LiDAR
  Consortium. This data set covers approximately 400 square miles. Data was collected
  in leaf-off conditions. An Optech 3100 LiDAR system was mounted in a fixed-wing
  aircraft and flown 1,200 meters above ground level (AGL). A pulse repetition frequency
  (PRF) of 71 kHz with at least 100% overlap (minimum 50% side-lap) was used. This
  data set acheived greater than 8 points per square meter.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
